const pages = "@/algo/modules/manage/pages";

const main = (
    root = "/main/manage",
    menu2 = "/main/algo",
    menu3 = "/main/counter"
) => [
    // {
    //     path: `/main/user/userInfo`,
    //     component: `${pages}/userInfo`,
    //     title: "用户管理",
    // },
    // {
    //     path: `/main/user/stockHolder`,
